import React,{Component} from'react'


class Services extends Component {
constructor(props) {
    super();

    this.state={
        count:'0',
        email:'sivaawesome234@gmail.com'
        
    }
}
render() {<div>
    return(<>
        {this.state.email}<br/><br/>
        {this.state.count}<br/>
        <button>Hitme</button>
        </>)
        </div>}


}

export default Services
